import React from "react";
import { FormGroup, FormRadio } from "shards-react";

export default function RadioInputGroup({ title, options, ...restProps }) {
  return (
      <fieldset>
        {options.length &&
          options.map(({ item, i }) => (
            <FormRadio key={`option-${i + 1}`}>{item}</FormRadio>
          ))}
      </fieldset>
  );
}
